  false,\n\t\"url\": null,\n\t\"notes\": \"A feature class describing the spatial
  location of the administrative boundary of the lands managed by the Forest Supervisor's
  office. An area encompassing all the National Forest System lands administered by
  an administrative unit. The area encompasses private lands, other governmental agency
  lands, and may contain National Forest System lands within the proclaimed boundaries
  of another administrative unit. All National Forest System lands fall within one
  and only one Administrative Forest Area. This dataset is derived from the USFS Southwestern
  Region ALP (Automated Lands Program) data Project. This is one of six layers derived
  from ALP for the purpose of supplying data layers for recourse GIS analysis and
  data needs within the Forest Service.  The six layers are Surface Ownership, Administrative
  Forest Boundary, District Boundary, Townships, Sections, and Wilderness. There were
  some gapes in the ALP data so a small portion of this dataset comes from CCF (Cartographic
  Feature Files) datasets and the USFS Southwestern Region Core Data Project. ALP
  data is developed from data sources of differing accuracy, scales, and reliability.
  \ Where available it is developed from GCDB (Geographic Coordinate Data Base) data.
  \ GCDB data is maintained by the Bureau of Land Management in their State Offices.
  GCDB data is mostly corner data.  Not all corners and not all boundaries are available
  in GCDB so ALP also utilizes many other data sources like CFF data to derive its
  boundaries. GCDB data is in a constant state of change because land corners are
  always getting resurveyed. The GCDB data used in this dataset represents a snapshot
  in time at the time the GCDB dataset was published by the BLM and may not reflect
  the most current GCDB dataset available. The Forest Service makes no expressed or
  implied warranty with respect to the character, function, or capabilities of these
  data.  These data are intended to be used for planning and analyses purposes only
  and are not legally binding with regards to title or location of National Forest
  System lands.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
